import React from "react";
import { Row, Button, Typography } from "antd";
import { useRouter } from "next/router";
import { useSelector } from "react-redux";
const { Text } = Typography;

import calculator from "../../back/calculator";

const End = () => {
	const { ans } = useSelector((state) => state.answer);
	const router = useRouter();

	const toTop = () => {
		router.push("/");
	};

	return (
		<>
			<Row>
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "50px",
						fontSize: "20px",
					}}
				>
					나의 유형은
				</Text>
				<Text
					strong
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "25px",
					}}
				>
					(여기에 유형 입력)
				</Text>
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "10px",
						color: "#be2edd",
					}}
				>
					{calculator(ans)}
				</Text>
			</Row>

			<Row>
				<Button
					style={{ display: "block", marginTop: "20px" }}
					onClick={toTop}
				>
					처음으로
				</Button>
			</Row>
		</>
	);
};

export default End;
